import React, { Component } from "react";
import { connect } from "react-redux";
import Dialog from "./Dialog";
import Footer from "./Footer";

class Dashboard extends Component {
  render() {
    return (
      <div>
        <div style={{ textAlign: "center" }} className="profile  card ">
          <h3>Profile </h3>
          <h5>name {this.props.profile.name}</h5>
          <h5>refs 34ffl</h5>
        </div>
        <div>
          <div className="tree">
            <div className="row">
              <div className="col wrapper show">
                name {this.props.profile.name}
              </div>
            </div>
            <div className="row">
              <div className="col center">memeber smith</div>
              <div className="col center">memeber john</div>
            </div>
          </div>
        </div>
        <Dialog />
        <Footer />
      </div>
    );
  }
}

Dashboard.propTypes = {};

// function mapDispatchToProps(dispatch) {
//   return {
//     login: data => dispatch(thunks.login(data))
//   };
// }

// export default Dashboard;

function mapStateToProps(state) {
  return {
    profile: state.user.profile
  };
}

export default connect(
  mapStateToProps,
  null
  // mapDispatchToProps
)(Dashboard);
